import TodoForm from "./TodoForm";

import todoList from './components/todolist/TodoForm.js';
import TodoList from "./TodoList";

function Todo() {


    return (
        <div className={"container"}>
            <h3>Add todo:</h3>
            <TodoForm></TodoForm>
            <TodoList></TodoList>
            {todoList.map((listItem, index) => (
                <p key={index} name={listItem}>{listItem}</p>
            ))}
        </div>
    )
}

export default Todo;
